import React from "react";

import  Container from "@mui/material/Container";
import SendIcon from '@mui/icons-material/Send';
import {Input}  from '@mui/icons-material'
import TextField from '@mui/material/TextField';

import SearchResult from "../components/Modules/SearchResults";
import { Box } from "@mui/system";
function MainSearch(props){
    //console.log("ssss  ",props)
    return (
        <section>    
            <article>   
                <h1> Animal Crossing Fishing Index</h1>
                        <form>
                            <input type='search' placeholder='Search for fish here' required={true} onChange={(event)=>{props.object.handleSearchChange(event.target.value)}}/>
                            <input type='submit' value='Search'/>
                        </form>
                <button onClick={()=>{props.object.props.navigation('/AllFish')}}>See All</button>
                 <div width='auto' height='500'>
                         <SearchResult  result={props.object.state.searchResult} nav={props.object.state.nav}></SearchResult>
                 </div>
            </article>
        </section>
    );

}
export default MainSearch;
